import React, { Component } from 'react';

import '../App.css';



class SearchForm  extends Component {
  constructor(props) {
  super(props);
  this.state = {value: ''};

  this.handleChange = this.handleChange.bind(this);
  this.handleSubmit = this.handleSubmit.bind(this);
  }

  handleChange(event) {
  this.setState({value: event.target.value});
  }

  handleSubmit(event) {
    event.preventDefault();
    this.props.onSubmitForms(this.state.value);
  }

    render(){
    return (
      <div className='form-wraper'>
      <form onSubmit={this.handleSubmit} className='search-form' >
          <input className='search-field' value={this.state.value} name='search' placeholder='Search' type='text' onChange={this.handleChange} />

        <button type='submit'>Search</button>
      </form>

        <p className="validation"> Given name not exist in database, try enter orher name </p>

      </div>
    )
  }
}

export default SearchForm;
